import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import { isAuthenticated } from "../auth";
import { getUserOrders } from "../user";

const Orders = () => {
  const { userId } = useParams();

  const [orders, setOrders] = useState();

  const { user, token } = isAuthenticated();

  const getUserOrderDetails = async (userId, token) => {
    try {
      const data = await getUserOrders(userId, token);
      if (data.error) {
        return console.log(data.error);
      } else {
        console.log("typeof", typeof data);
        console.log("Data", data);
        return setOrders(data);
      }
    } catch (error) {}
  };

  useEffect(() => {
    getUserOrderDetails(userId, token);
  }, []);

  return (
    <section className="userBoard-right-section accounts-section">
      <h1 className="userBoard-right-header">Orders</h1>
      <div className="userBoard-right-subSec">
        <div className="userBoard-right-customer-order-table">
          <div className="userBoard-right-customer-order-table-head-sec">
            <div className="userBoard-right-customer-order-table-head-value">
              Products
            </div>
            <div className="userBoard-right-customer-order-table-head-value">
              Order ID
            </div>
            <div className="userBoard-right-customer-order-table-head-value">
              Status
            </div>
            <div className="userBoard-right-customer-order-table-head-value">
              Total
            </div>
            <div className="userBoard-right-customer-order-table-head-value">
              Payment Mode
            </div>
            <div className="userBoard-right-customer-order-table-head-value">
              Delivery Boy
            </div>
            <div className="userBoard-right-customer-order-table-head-value">
              Action
            </div>
          </div>
          {orders &&
            orders.map((order, index) => {
              return (
                <div
                  className="userBoard-right-customer-order-table-body-sec"
                  key={index}
                >
                  <div className="userBoard-right-customer-order-table-body-value">
                    {order.Oproducts}
                  </div>
                  <div className="userBoard-right-customer-order-table-body-value">
                    {order._id}
                  </div>
                  <div className="userBoard-right-customer-order-table-body-value">
                    {order.Ostatus}
                  </div>
                  <div className="userBoard-right-customer-order-table-body-value">
                    {order.Ototal}
                  </div>
                  <div className="userBoard-right-customer-order-table-body-value">
                    {order.OpaymentMode}
                  </div>
                  <div className="userBoard-right-customer-order-table-body-value">
                    {order.OemployeeId}
                  </div>
                  <div className="userBoard-right-customer-order-table-body-value">
                    <button>Preview</button>
                  </div>
                </div>
              );
            })}
        </div>
      </div>
    </section>
  );
};

export default Orders;
